css:
.project-manager-list-group {
  color: #7f8c8d;
  text-shadow: none;
  padding: 1px 2px;
  margin-left: 10px;
  background: rgba(236, 240, 241, 0.09999999999999998);
  border-radius: 1px;
}
.selected .project-manager-list-group {
  color: #7f8c8d;
}
.project-manager-devmode {
  float: right;
}
.project-manager-devmode:before {
  content: "\f065";
  color: #e74c3c;
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  text-shadow: none;
  font-size: 14px;
  line-height: 1;
  display: inline-block;
}
